import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';

// Import components for each section
import CreateStudent from './components/CreateStudent';
import StudentList from './components/StudentList';

import CreateReservation from './components/CreateReservation';
import ReservationList from './components/ReservationList';

import CreateBooking from './components/CreateBooking';
import BookingList from './components/BookingList';

import CreatePaymentMethod from './components/CreatePaymentMethod';
import PaymentMethodList from './components/PaymentMethodList';

import CreateEquipment from './components/CreateEquipment';
import EquipmentList from './components/EquipmentList';

// Home Page Component with Navigation
function Home() {
  return (
    <div className="home">
      <h1>LIC Management System</h1>
      <nav>
        <Link to="/student-management">Student Management</Link>
        <Link to="/reservation-management">Reservation Management</Link>
        <Link to="/booking-management">Booking Management</Link>
        <Link to="/payment-method-management">Payment Method Management</Link>
        <Link to="/equipment-management">Equipment Management</Link>
      </nav>
    </div>
  );
}

// Separate pages for each section
function StudentManagement() {
  return (
    <div>
      <header className="header">
<h1>LIC Management System</h1>
<div className="nav-buttons">
<button>Student Management</button>
<button>Reservation Management</button>
<button>Booking Management</button>
<button>Payment Method Management</button>
<button>Equipment Management</button>
</div>
</header>
      <h2>Student Management</h2>
      <CreateStudent />
      <StudentList />
    </div>
  );
}

function ReservationManagement() {
  return (
    <div>
      <header className="header">
<h1>LIC Management System</h1>
<div className="nav-buttons">
<button>Student Management</button>
<button>Reservation Management</button>
<button>Booking Management</button>
<button>Payment Method Management</button>
<button>Equipment Management</button>
</div>
</header>
      <h2>Reservation Management</h2>
      <CreateReservation />
      <ReservationList />
    </div>
  );
}

function BookingManagement() {
  return (
    <div>
      <header className="header">
<h1>LIC Management System</h1>
<div className="nav-buttons">
<button>Student Management</button>
<button>Reservation Management</button>
<button>Booking Management</button>
<button>Payment Method Management</button>
<button>Equipment Management</button>
</div>
</header>
      <h2>Booking Management</h2>
      <CreateBooking />
      <BookingList />
    </div>
  );
}

function PaymentMethodManagement() {
  return (
    <div>
      <header className="header">
<h1>LIC Management System</h1>
<div className="nav-buttons">
<button>Student Management</button>
<button>Reservation Management</button>
<button>Booking Management</button>
<button>Payment Method Management</button>
<button>Equipment Management</button>
</div>
</header>
      <h2>Payment Method Management</h2>
      <CreatePaymentMethod />
      <PaymentMethodList />
    </div>
  );
}

function EquipmentManagement() {
  return (
    <div>
      <header className="header">
<h1>LIC Management System</h1>
<div className="nav-buttons">
<button>Student Management</button>
<button>Reservation Management</button>
<button>Booking Management</button>
<button>Payment Method Management</button>
<button>Equipment Management</button>
</div>
</header>
      <h2>Equipment Management</h2>
      <CreateEquipment />
      <EquipmentList />
    </div>
  );
}

// Main App Component
function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/student-management" element={<StudentManagement />} />
          <Route path="/reservation-management" element={<ReservationManagement />} />
          <Route path="/booking-management" element={<BookingManagement />} />
          <Route path="/payment-method-management" element={<PaymentMethodManagement />} />
          <Route path="/equipment-management" element={<EquipmentManagement />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
